    return(
        <Link className='next-video' to={`/videos/${next.id}`}>
            <h3 className='next-video__heading'>Next Video</h3>

            {videos.map(video => (
            <VideoThumbnail 
                key={video.id}
                videoImage={video.image}
                title={video.title}
                creator={video.channel}
                onClick={() => onVideoSelect(video.id)}
            />
            ))}
        </Link>
    );
}

